import React from 'react';
import { useStateContext } from '../context/StateContext';
import { useNavigate } from 'react-router-dom';

const TableView = () => {
  const { selectedTableData } = useStateContext();
  const navigate = useNavigate();

  if (!selectedTableData || !selectedTableData.headers || !selectedTableData.rows) {
    return (
      <div className="table-view-empty">
        <p>No table data available or data is loading...</p>
        <button onClick={() => navigate(-1)}>Go Back</button>
      </div>
    );
  }

  return (
    <div className="table-view">
      <div className="table-header">
        <h2>{selectedTableData.name || 'Untitled Table'}</h2>
        <button onClick={() => navigate(-1)}>Go Back</button>
      </div>
      
      <div className="table-container">
        <table>
          <thead>
            <tr>
              {selectedTableData.headers?.map((header, index) => (
                <th key={index}>{header}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {selectedTableData.rows?.map((row, rowIndex) => (
              <tr key={rowIndex}>
                {row?.map((cell, cellIndex) => (
                  <td key={cellIndex}>{cell}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default TableView;
